> Florida Bush donors pitch 'long haul' after initial 'shock and awe' In this Sept. 29, 2015, photo, Republican presidential candidate, former Florida Gov. Jeb Bush outlines his energy policy during a visit to Rice Energy, an oil and gas company based in Canonsburg, Pa. Bush’s challenge in the first half of the year was daunting yet simple. To be considered a fundraising success, the Republican presidential candidate had to hit the magic number of $100 million, an ambitious goal set by some in his campaign. And he did. As another fundraising period ends, what now constitutes success for Bush isn’t as clear cut. (AP Photo/Gene J. Puskar) 
